import React from "react";
import { useNavigate } from "react-router-dom"; // useNavigate hook'unu ekleyin
import MenuIcon from "@mui/icons-material/Menu";
import "../styles/MenuAppBar.css";
import LogoImage from "../assets/logo.jpeg";
import OtherHousesOutlinedIcon from "@mui/icons-material/OtherHousesOutlined";
import LocationIcon from "@mui/icons-material/LocationOn";
import axios from "axios";
import Dropdown from "./Dropdown";

function MenuAppBar() {
  const navigate = useNavigate(); // useNavigate hook'unu kullanın

  const navigateToLocation = async () => {
    try {
      const userEmail = sessionStorage.getItem("userEmail"); // sessionStorage'den email bilgisini al
      console.log("userEmail", userEmail);
      axios
        .get(`http://localhost:8081/api/posts/getPostsAroundUser/${userEmail}`)
        .then((response) => {
          const locations = response.data;
          console.log("response", response.data);
          navigate("/map", { state: { locations } });
        })
        .catch((error) => {
          console.error("Error fetching posts:", error);
          // Handle error as needed (e.g., show user a message)
        });
    } catch (error) {
      console.error("Error fetching locations:", error);
    }
  };

  return (
    <div>
      <div className="navbar">
        <div
          className="img-navbarLogo"
          style={{ backgroundImage: `url(${LogoImage})`, width: "50px" }}
        ></div>
        <button
          style={{
            backgroundColor: "white",
            cursor: "pointer",
            border: "none",
            height: "7vmin",
          }}
        >
          <OtherHousesOutlinedIcon />
        </button>
        <button
          style={{
            cursor: "pointer",
            backgroundColor: "white",
            border: "none",
            height: "5vmin",
          }}
          onClick={navigateToLocation}
        >
          <LocationIcon />
        </button>
        <div>
          <button
            style={{
              cursor: "pointer",
              backgroundColor: "white",
              border: "none",
              height: "5vmin",
            }}
          >
            <MenuIcon />
          </button>
        </div>
        <div>
          {" "}
          <Dropdown />{" "}
        </div>
      </div>
    </div>
  );
}

export default MenuAppBar;
